Number.prototype.toTimeConvert=function(){const t=Math.floor(this/3600);Math.floor(this-3600*t/60)};const app=new Vue({el:"#app",data:{reqExpOut:0,expAchievedOut:1,expLvlUpOut:0,goalLvlExpIn:0,goalLvlExpOut:0,killToLvlUp:0,timeTolvlUp:0,killToGoalLvlUp:0,timeToGoalLvlUp:1,currentLvl:1,expAchievedIn:1,expPerMobin:1,errors:[],expToGoalLvl:0},computed:{expOut:function(){const t=this.findLvlExp();return this.goalLvlExpIn=this.currentLvl,this.reqExpOut=t.exp},expAchieved:function(){const t=this.findLvlExp();return this.expAchievedOut=Math.round(t.exp*this.expAchievedIn/100)},expToLvl:function(){const t=DATA.find(t=>t.level==this.currentLvl);return this.expLvlUpOut=Math.round(t.exp-this.expAchievedOut)},toGoalLvl:function(){const t=DATA.findIndex(t=>t.level==this.currentLvl),e=DATA.findIndex(t=>t.level==this.goalLvlExpIn),o=DATA.slice(t,e).map(t=>t.exp).reduce((t,e)=>t+e,0);return this.expToGoalLvl=o},expPerMobOut:function(){const t=this.expLvlUpOut/this.expPerMobin;return Math.round(t)},mobToGoalLvl:function(){const t=this.expToGoalLvl/this.expPerMobin;return Math.round(t)},timeTolvl:function(){const t=this.expLvlUpOut/this.timeTolvlUp;console.log(t)}},methods:{findLvlExp:function(){return DATA.find(t=>t.level==this.currentLvl)},splitThousands:function(t){return t.toString().replace(/\B(?=(\d{3})+(?!\d))/g,".")},toTime:function(t){n=parseInt(t,10);let e=t;e-=3600*Math.floor(e/86400)*24;const o=Math.floor(e/3600);second-=3600*o}}});